import React, {Component} from 'react';

import Listavideos from './Listavideos';





class Page1 extends Component {
	constructor(props){
    super(props);
    
  }

	onVideoSelect = (video )=>{
    this.setState({selectedVideos:this.state.video});
    
  };		

	render(){
		return(
			<div>
				
        		<Listavideos videos={this.props.videos} onVideoSelect={this.onVideoSelect} />
			</div>


			)
	}
}
export default Page1;
